import { useRouter } from "next/router";

export default () => {
  const currentPage = useRouter().query.page;

  return (
    <div>
      <h3>Orders:</h3>
      <PageSelector current={currentPage} atAll={NaN} />
      <OrdersTable />
    </div>
  );
};

const PageSelector = props => {
  return (
    <div>
      <span>{props.current}</span>
    </div>
  );
};

const OrdersTable = props => (
  <table>
    <thead>
      <tr>
        <th>user_email</th>
        <th>date</th>
        <th>value</th>
        <th>currency</th>
        <th>status</th>
      </tr>
    </thead>
  </table>
);
